package Algorithms.String;

public class Valid2 {

    /*
     * Leetcode
     *
     * Given a non-empty string s, you may delete at most one character. Judge whether you can make it a palindrome.
     *
     * https://leetcode.com/problems/valid-palindrome-ii/
     *
     */

    public static void main(String... args) {

        Algorithms.String.Valid2 a = new Algorithms.String.Valid2();

        boolean test1 = a.validPalindrome("abca");
        boolean expected1 = true;
        System.out.println("In [" + test1 + "] Out [" + expected1 + "]");
        assert test1 == expected1 : "Error";

        boolean test2 = a.validPalindrome("");
        boolean expected2 = false;
        System.out.println("In [" + test2 + "] Out [" + expected2 + "]");
        assert test1 == expected1 : "Error";

        boolean test3 = a.validPalindrome("");
        boolean expected3 = false;
        System.out.println("In [" + test3 + "] Out [" + expected3 + "]");
        assert test3 == expected3 : "Error";




    }


    private boolean isPalindromeString(StringBuilder ss) {
        boolean result = false ;
        int len = ss.length() ;
        for (int x = 0; x < len+1/2; x++) {

            if ( ss.charAt(x) - ss.charAt(len-1-x) != 0) {
                result = false;
                return result;
            } else {
                result = true;
            }
        }
        return result;
    }

    public boolean validPalindrome(String s) {

        StringBuilder sb = new StringBuilder(s);

        boolean result = false;
        if (isPalindromeString(sb)) {
            return true;
        } else {
            result = false;
        }

        for (int x=0;x<sb.length();x++){
            StringBuilder sbb = new StringBuilder(s);
            sbb.deleteCharAt(x);
            if (isPalindromeString(sbb)) {
                return true;
            } else {
                result = false;
            }
        }

        return result;
    }


}
